import { makeStyles } from '@material-ui/core'

export default makeStyles ((theme) => ({
        root: {
          width: '95%',
          maxHeight: '60%',
          marginTop: 100,
          overflowX: "auto",
          marginLeft: 50, 
          marginRight: 50 
        },
        container: {
          maxHeight: 450,
          width: '85%',


        },

}));
